import React from "react";
import "./"

const UserCard = () => {
    return (
        <div className="parent">
            <h1>User Card</h1>
            <div className="chil-1">
                <img src="./avatar3.png" alt="Avatar" />
            </div>
            <div className="child-2">
                <h3>Name</h3>
                <p>Username</p>
                <p>Email</p>
            </div>
        </div>
    );
};

export default UserCard;
